// src/index.ts
var server = new Server(
  {
    name: "context-echo",
    version: "1.0.0"
  },
  {
    capabilities: {
      tools: {}
    }
  }
);
server.setRequestHandler(ListToolsRequestSchema, async () => {
  return {
    tools: [
      {
        name: "memory.add",
        description: "Add an entity, relation, or fact to the user's knowledge graph.",
        inputSchema: {
          type: "object",
          properties: {
            userId: { type: "string" },
            entity: { type: "object" },
            relation: { type: "object" },
            fact: { type: "object" }
          },
          required: ["userId"]
        }
      },
      {
        name: "memory.query",
        description: "Query the user's knowledge graph for relevant context.",
        inputSchema: {
          type: "object",
          properties: {
            userId: { type: "string" },
            query: { type: "string" }
          },
          required: ["userId", "query"]
        }
      },
      {
        name: "memory.summarize",
        description: "Summarize the user's knowledge graph.",
        inputSchema: {
          type: "object",
          properties: {
            userId: { type: "string" }
          },
          required: ["userId"]
        }
      }
    ]
  };
});
server.setRequestHandler(CallToolRequestSchema, async (request) => {
  const { name, arguments: args } = request.params;
  if (!args || typeof args.userId !== "string") {
    throw new Error("userId is required and must be a string");
  }
  const userId = args.userId;
  switch (name) {
    case "memory.add": {
      const graph = await loadGraph(userId);
      let addedCount = 0;
      if (args.entity) {
        graph.entities.push(EntitySchema.parse(args.entity));
        addedCount++;
      }
      if (args.relation) {
        graph.relations.push(RelationSchema.parse(args.relation));
        addedCount++;
      }
      if (args.fact) {
        graph.facts.push(FactSchema.parse(args.fact));
        addedCount++;
      }
      if (addedCount > 0) {
        await saveGraph(userId, graph);
        return {
          content: [{ type: "text", text: `Successfully added ${addedCount} items to memory for user ${userId}.` }]
        };
      }
      return {
        content: [{ type: "text", text: "No items provided to add." }]
      };
    }
    case "memory.query": {
      const query = String(args.query).toLowerCase();
      const graph = await loadGraph(userId);
      const matchedEntities = graph.entities.filter(
        (e) => e.name.toLowerCase().includes(query) || e.type && e.type.toLowerCase().includes(query)
      );
      const matchedRelations = graph.relations.filter(
        (r) => r.source.toLowerCase().includes(query) || r.target.toLowerCase().includes(query) || r.type.toLowerCase().includes(query)
      );
      const matchedFacts = graph.facts.filter(
        (f2) => f2.content.toLowerCase().includes(query)
      );
      const result = {
        entities: matchedEntities,
        relations: matchedRelations,
        facts: matchedFacts
      };
      return {
        content: [{ type: "text", text: JSON.stringify(result, null, 2) }]
      };
    }
    case "memory.summarize": {
      const graph = await loadGraph(userId);
      const summary = [
        `Knowledge Graph Summary for User: ${userId}`,
        `- Entities: ${graph.entities.length}`,
        `- Relations: ${graph.relations.length}`,
        `- Facts: ${graph.facts.length}`,
        "",
        "Facts recorded:",
        ...graph.facts.map((f2) => `- [${f2.confidence.toFixed(2)}] ${f2.content} (${new Date(f2.timestamp).toLocaleDateString()})`)
      ].join("\n");
      return {
        content: [{ type: "text", text: summary }]
      };
    }
    default:
      throw new Error(`Unknown tool: ${name}`);
  }
});
async function main() {
  const transport = new StdioServerTransport();
  await server.connect(transport);
  console.error("Context Echo MCP Server running on stdio");
}
main().catch((error48) => {
  console.error("Fatal error in main():", error48);
  process.exit(1);
});

